import React from "react";
import styled from "styled-components";
import { Contentdiv, TitleDiv, Row, Col, TextBox } from "./styles/commonstyle";

const Blog = () => {
  return (
    <React.Fragment>
      <Contentdiv>
        <TitleDiv>Diplomes & soft skills</TitleDiv>
        <Row>
          <Col>
            <TextBox>
            <div class="list-group">
              <a href="#" class="list-group-item list-group-item-action list-group-item-primary">Permit B & 2 roues</a>
              <a href="#" class="list-group-item list-group-item-action list-group-item-secondary">Production de Documentations</a>
              <a href="#" class="list-group-item list-group-item-action list-group-item-success">ANSSI moock certified</a>
              <a href="#" class="list-group-item list-group-item-action list-group-item-danger">TEOIC - B2 ( 2017 & 2019 )</a>
              <a href="#" class="list-group-item list-group-item-action list-group-item-warning">Opérateur SSI</a>
              <a href="#" class="list-group-item list-group-item-action list-group-item-info">MAO & Disk Jockey</a>
              <a href="#" class="list-group-item list-group-item-action list-group-item-light">Facteur de bonne humeur & aventurié</a>
            </div>
            </TextBox>
          </Col>
        </Row>
      </Contentdiv>
    </React.Fragment>
  );
};

export default Blog;


// Intégration et livraison continue, Production de Documentations, Méthodes Agiles, Certifié ANSSI, Communication, TOEIC - B2 ( renouvelé en 2019 ), 
// Operateur de Sécurité numérique, Responsable SSI, Permits B et 2 roues, Audio production et MAO, Production video, Curieux , Facteur de bonne humeur, Aventurier.
